//////////////////////////////////////////////////////////////////////////////
//CUT SCENE ROM BANK
////////////////////////////////////////////////////////////////////////

extern void fadeInSprites(UINT8);
extern void fadeInBkg(UINT8);
extern void fadeOutSprites(UINT8);
extern void fadeOutBkg(UINT8);


extern UINT8 switchRomBanks();															// SWITCH ROM BANKS TO LOAD GAME DATA / ALLOW FOR PLAYABLE BITS
extern UINT8 hMode;
extern UINT8 i,j,k,l,pX,pY;
extern UINT16 ii,jj,kk,ll;
extern UINT8 lastkeys;
extern UINT8 newBank,initBank;																// SET TO 1 WHEN WE SWITCH ROM BANKS
extern UINT8 scene;

	void updateGame(){
	// INIT
		if (initBank == 1){
		HIDE_BKG;
		HIDE_WIN;
		HIDE_SPRITES;

			for (i=0; i!=40; i++){
			move_sprite(i,0,0);
			}
	
			if(hMode == 0){
			set_bkg_data(0,256,endingBkgTiles);
			} else {
			set_bkg_data(0,256,endingBkgTilesNude);
			}
			
		set_bkg_tiles(0,0,20,18,endingTiles);			
		set_bkg_tiles(12,6,3,1,eyesClosed);			
		
			if (_cpu == CGB_TYPE){
			VBK_REG = 1;				
			set_sprite_palette(0,2,spritePalette);
			set_bkg_palette(0,5,bkgPalette);
			set_bkg_tiles(0,0,20,18,mapColours);
			VBK_REG = 0;
			}
		
		initBank = 0;
		fadeInBkg(10);

			if (_cpu == CGB_TYPE){
			VBK_REG = 1;				
			set_sprite_palette(0,2,spritePalette);
			set_bkg_palette(0,5,bkgPalette);
			VBK_REG = 0;
			}
		
		k=0;
		l=0;		

			
		} else {
		
	
			if (k !=255){
			k++;
			
				switch (k % 20){
				case 1:
				set_bkg_tiles(12,8,2,1,mouthOpen1);
				break;
				case 11:
				set_bkg_tiles(12,8,2,1,mouthOpen2);
				break;
				}
			
			} else {
			l++;
			
				if (l==64){
				set_bkg_tiles(12,6,3,1,wink);
				}
				
				if ((joypad() & J_A) || (joypad() & J_START)){
				fadeOutBkg(30);
				scene=1;
				initBank=1;
				newBank = 1;
				}
			
			}

			
		SHOW_BKG;
		HIDE_WIN;
		SHOW_SPRITES;
		}
	
	
	}
